import "./NavLogo.scss";
import Logo from "../../../assets/images/rae-chastain-logo.png";

const NavLogo = () => {
    return (
        <div className="nav-logo">
            <img className="nav-image" src={Logo} alt="rae chastain's logo" />
        </div>
    );
};

export default NavLogo;
